import React, { useEffect, useState } from 'react'

function App() {
  const[posts, setPosts] = useState([]);

  useEffect(() => {
    fetch('/posts').then(
      response => response.json()
    ).then(
      data => {
        setPosts(data);
        console.log(data);
      }
    )
  }, []);

  return (
    <>
      {(typeof posts === 'undefined') ? (
        <p>loading posts...</p>
      ) : (
        posts.map((post, i) => (
          <>
            <p>post by: {post.userid}</p>
            <p key={i}>{post.message}</p>
            <p>{post.datecreated}</p>
          </>
        ))
      )}
    </>
  )
}

export default App
